import Link from "next/link";
import styles from './Header.module.css';

export default () => (
  <div>
    <Link href="/"><a>Home</a></Link>
    <Link href="/test"><a>Test</a></Link>
    <Link href="/siemanko" as="/test/siemanko"><a>Siemanko</a></Link>
  </div>
)

